import React from "react";

function Stats() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">
          <h1>Trust with Confidence</h1>
        </div>
        <div className="col-6">
          <img
            src="media\images\ecosystem.png"
            alt="ecosystem"
            style={{ width: "75%" }}
          />
        </div>
      </div>
    </div>
  );
}

export default Stats;
